import React from "react";
import { Grid, Typography, Button, Chip, TextField } from "@material-ui/core";
import { useHistory } from "react-router-dom";

import FormLogin from "../../Components/FormLogin";
import { useStyles } from "./style";
import {
  goToCandidate,
  goToCompany,
  goToMentor,
} from "../../Routes/coordinators";

export default function SelectPage() {
  const classes = useStyles();
  const history = useHistory();

  const handleClickIndicado = () => {
    goToCandidate(history);
  };
  const handleClickIndicar = () => {
    goToMentor(history);
  };
  const handleClickContratar = () => {
    goToCompany(history);
  };

  return (
    <Grid container className={classes.root}>
      <Grid item className={classes.containerButtons} xs={12} sm={6}>
        <Typography className={classes.opcao} component="p" variant="h5">
          Vamos começar a sua trilha!
        </Typography>
        <Typography className={classes.step} component="p" variant="h5">
          <Chip className={classes.colorchip} label="1." color="primary" />{" "}
          Cadastro
        </Typography>
        <TextField
          label="Nome completo:"
          name="nomeCompleto"
          variant="outlined"
        />
        <TextField label="    Email:" name="    email" variant="outlined" />
        <TextField
          label="Qual o seu melhor telefone para contato?"
          name="contato"
          variant="outlined"
        />
        <TextField
          label="Fale um pouco sobre você? O que você está buscando para sua próxima
        experiência profissional?"
          variant="outlined"
          name="experiencia"
          multiline
          rows="10"
        />
      </Grid>
      <Grid className={classes.gridApresentacao} item xs={false} sm={6}></Grid>
    </Grid>
  );
}
